    const {id} = useParams()
    useEffect(() => {
        detailId()
    },[])

    const detailId = async() => {
        const urlGetById = `http://localhost:5000/login/recupereInfoVoiture/${id}`
        await axios.get(urlGetById,{headers:{"token":window.localStorage.token}}).then((res) => {console.log(res)})
    }
    return (
        <div>
         <Presentation/>
            <h1> DetailVoiture {id} </h1>
            <Footer/>
        </div>
    );
};

export default DetailVoiture;
